  \"2015-02-04T18:50:49.334192\",\n\t\"name\": \"2011-housing-market-typology-a6419\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Typology will assist city government,
  local foundations and non-profits to understand local market strengths and to appropriately
  match neighborhood strategies to market conditions, for the best use of public and
  private resources. In addition, the typology will inform neighborhood level planning
  efforts and provide residents with an understanding of the local housing market
  conditions in their communities. Regional Choice: Competitive housing markets with
  high owner-occupancy rates and high property values in comparison to all other market
  types. Foreclosure, vacancy and abandonment rates are low.  Middle Market Choice:
  Housing prices above the cityu2019s average with strong ownership rates, and low
  vacancies, but with slightly increased foreclosure rates.  Middle Market:  Median
  sales values of $91,000 (above the Cityu2019s average of $65,000) as well as high
  homeownership rates. These markets experienced higher foreclosure rates when compared
  to higher value markets, with slight population loss.  Middle Market Stressed: Slightly
  lower home sale values than the Cityu2019s average, and have not shown significant
  sales price appreciation. Vacancies and foreclosure rates are high, and the rate
  of population loss has increased in this market type, according to the 2010 Census
  data.  Distressed Market: , Have experienced significant deterioration of the housing
  stock. This market category contains the highest vacancy rates and the lowest homeownership
  rates, compared to the other market types.  It also has experienced some of the
  most substantial population losses in the City during the past decade.\",\n\t\"license_title\":
